import React, { useEffect, useState } from 'react';
import axios from 'axios';

function RequestItemsPage() {
  const [inventory, setInventory] = useState([]);
  const [requests, setRequests] = useState({});
  const [message, setMessage] = useState('');
  const [user, setUser] = useState(null);

  useEffect(() => {
    const storedUser = JSON.parse(localStorage.getItem('user'));
    setUser(storedUser);

    axios.get('/api/inventory')
      .then(res => setInventory(res.data))
      .catch(err => console.error('Error fetching inventory:', err));
  }, []);

  const handleChange = (itemId, quantity) => {
    setRequests(prev => ({
      ...prev,
      [itemId]: quantity
    }));
  };

  const handleSubmit = () => {
    const payload = Object.entries(requests)
      .filter(([_, qty]) => qty > 0)
      .map(([itemId, qty]) => ({
        itemId,
        quantity: Number(qty),
        requestedBy: user?.username || 'unknown',
        status: 'pending'
      }));

    if (payload.length === 0) {
      setMessage('‚ùå Please select at least one item to request.');
      return;
    }

    axios.post('/api/requests', { requests: payload })
      .then(() => {
        setMessage('‚úÖ Request submitted successfully!');
        setRequests({});
      })
      .catch(err => {
        console.error(err);
        setMessage('‚ùå Error submitting request.');
      });
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>üì¨ Request Inventory Items</h2>

      {inventory.length === 0 ? (
        <p>No items available.</p>
      ) : (
        <table style={styles.table}>
          <thead>
            <tr style={styles.tableHeader}>
              <th style={styles.th}>Item</th>
              <th style={styles.th}>Location</th>
              <th style={styles.th}>Available</th>
              <th style={styles.th}>Request Qty</th>
            </tr>
          </thead>
          <tbody>
            {inventory.map(item => (
              <tr key={item._id}>
                <td style={styles.td}>{item.itemName}</td>
                <td style={styles.td}>{item.location}</td>
                <td style={styles.td}>{item.count}</td>
                <td style={styles.td}>
                  <input
                    type="number"
                    min="0"
                    value={requests[item._id] || ''}
                    onChange={(e) => handleChange(item._id, e.target.value)}
                    style={styles.input}
                  />
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}

      <button onClick={handleSubmit} style={styles.submitBtn}>Submit Request</button>

      {message && <p style={styles.message}>{message}</p>}
    </div>
  );
}

const styles = {
  container: {
    padding: '30px',
    minHeight: '100vh',
    background: 'linear-gradient(to right, #002244, #004488)',
    color: '#fff',
    fontFamily: 'Arial, sans-serif',
  },
  heading: {
    fontSize: '28px',
    fontWeight: 'bold',
    marginBottom: '20px'
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
    backgroundColor: '#fff',
    color: '#000',
    borderRadius: '10px',
    overflow: 'hidden',
    marginBottom: '20px'
  },
  tableHeader: {
    backgroundColor: '#f0f0f0'
  },
  th: {
    padding: '12px',
    borderBottom: '1px solid #ddd',
    textAlign: 'left'
  },
  td: {
    padding: '10px',
    borderBottom: '1px solid #ddd'
  },
  input: {
    width: '60px',
    padding: '6px',
    borderRadius: '4px',
    border: '1px solid #ccc'
  },
  submitBtn: {
    padding: '10px 20px',
    backgroundColor: '#28a745',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer'
  },
  message: {
    marginTop: '15px',
    fontSize: '16px'
  }
};

export default RequestItemsPage;
